import { Data, Params } from 'src/request/entity.d';
import { get, post } from "src/request/api"

export const query = (params: Params) => {
 return post('/redlists/matchconfig/getMatch', params)
}
export const getMatch = (params: Params) => {
 return get('/index/redlists/matchconfig/getMatchType', params)
}
export const queryByType = (data: Data) => {
 return post('/index/redlists/matchinfo/getMatchInfosByType', data)
}
